import React from 'react';
import { useState, useEffect } from 'react';
var axios = require('axios');

var query = 'https://api.anchorage-development.com/v2/vaults/8fd09f37392e0faa77ab858af3ee350c/wallets';
var apiKey = 'faf601815e5f1c347b1ca98f4046965a9bff0302e311f2b048c2c98ffacd7947';

export default function App() {
  const [isLoading, setLoading] = useState(true);
  const [wallet, setWallet] = useState();

  useEffect(() => {
    axios.get(query, {
          headers: {
            'Api-Access-Key': apiKey
          }
        })
        .then((res) => {
          setWallet(res.data.data);
          setLoading(false);
        })
  }, []);

  if (isLoading) {
    return <div>loading</div>
  }

  const wallets = wallet.map((item) => {
    <li>item.walletName</li>
  });
  console.log('wallets',wallets);

  return (
    <ul>{wallets}</ul>
  )
}
